import React from "react";

import Curved_Arrow from '../../../1_image_or_icon/curved_arrow-icon.png'

export const My_Account = () => {

    const Default_Info_Dispenser = (section,input) => {
        return <div
            style={{
                display:'flex',
                flexDirection: 'column',
                justifyContent: 'space-around',
                backgroundColor: 'white',
                padding: '1vh 3vw',
                minHeight: '6.5vh',
                borderRadius: '10px'
            }}
        >

            <span> {section}</span>
            <span>
                <img
                src={Curved_Arrow}
                style={{
                    width:'5vw',
                    transform: 'rotate(270deg)'
                }}
                >
                </img> {input}</span>
        </div>
    }

    return <React.Fragment>

        <div
        className="Personalize_Data_Page_Container"
        >

        <div
        style={{
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'space-between',

            height: 'fit-content',
            padding: '5vh 0vw 5vh 7vw',
            
            fontFamily: '큐트신민상',
            fontSize: '5.5vw'
        }}
        >

        <span>profile image</span>

        {Default_Info_Dispenser('Name',' "kim" ')}

        {Default_Info_Dispenser('Phone Number', '010-4876-2977')}

        {Default_Info_Dispenser('Email_Address', 'ereh_@naver.com')}

        {Default_Info_Dispenser('Address', '강동구청')}
        
        

        <span>id</span>
        <span>password</span>
        
        {Default_Info_Dispenser('Position', 'Reviewer')}

        </div>



        </div>

    </React.Fragment>

}

export default My_Account
